const Todo = () => {
    return (
        <StyleTodo>
            <AllTodo>
                <Form>
                    <Input></Input>
                    <MdMapsUgc className="button" />
                </Form>
                <div>
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                </div>
            </AllTodo>
        </StyleTodo>
    );
};

export default Todo;
